import React, { Component } from 'react';
import Header from '../header/header';
import Button from './buttonprop/buttonprop';
import Colorbtnlist from './color-button/colorbtnlist';
import Containbtn from './Contained-Button/containedbtn_list';
import Socialbtn from './social-button/socialiconlist';
import Rdiobtn from './togglebtn/togglbtn';
import Label_button from './label-button/label_button';

import { Icon } from 'react-icons-kit';
import {userPlus} from 'react-icons-kit/feather/userPlus';
import {chevronRight} from 'react-icons-kit/feather/chevronRight';
import {cloud} from 'react-icons-kit/feather/cloud';
import {heart} from 'react-icons-kit/feather/heart';
import {facebookF} from 'react-icons-kit/fa/facebookF';
import {instagram} from 'react-icons-kit/feather/instagram';
import {twitter} from 'react-icons-kit/feather/twitter';
import {dribbble} from 'react-icons-kit/icomoon/dribbble';
import {behance} from 'react-icons-kit/icomoon/behance';





class button extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
           header: [
              {title: 'Button'}
            ],
            colorbtn: [
               {
                     colorname: 'Red',
                     class: 'btn-red' 
               },
               {
                     colorname: 'Orange',
                     class: 'btn-orange' 
                },
                {
                     colorname: 'Yellow',
                     class: 'btn-yellow' 
                },
                 {
                    colorname: 'La Rioja',
                    class: 'btn-la-rioja' 
                },
                {
                    colorname: 'Pelorous',
                    class: 'btn-pelorous' 
                },
                {
                   colorname: 'Mulberry',
                   class: 'btn-mulberry' 
               },
               {
                        colorname: 'Red',
                        class: 'btn-red' 
                },
                {
                        colorname: 'Orange',
                        class: 'btn-orange' 
                },
                {
                        colorname: 'Yellow',
                        class: 'btn-yellow' 
                },
                    {
                    colorname: 'La Rioja',
                    class: 'btn-la-rioja' 
                },
                {
                    colorname: 'Pelorous',
                    class: 'btn-pelorous' 
                },
                {
                    colorname: 'Mulberry',
                    class: 'btn-mulberry' 
                },
                {
                    colorname: 'Red',
                        class: 'btn-line-red' 
                },
                {
                        colorname: 'Orange',
                        class: 'btn-line-orange' 
                },
                {
                        colorname: 'Yellow',
                        class: 'btn-line-yellow' 
                },
                    {
                    colorname: 'La Rioja',
                    class: 'btn-line-la-rioja' 
                },
                {
                    colorname: 'Pelorous',
                    class: 'btn-line-pelorous' 
                },
                {
                    colorname: 'Mulberry',
                    class: 'btn-line-mulberry' 
                },
                {
                    colorname: 'Red',
                        class: 'btn-line-red' 
                },
                {
                        colorname: 'Orange',
                        class: 'btn-line-orange' 
                },
                {
                        colorname: 'Yellow',
                        class: 'btn-line-yellow' 
                },
                    {
                    colorname: 'La Rioja',
                    class: 'btn-line-la-rioja' 
                },
                {
                    colorname: 'Pelorous',
                    class: 'btn-line-pelorous' 
                },
                {
                    colorname: 'Mulberry',
                    class: 'btn-line-mulberry' 
                },
            ],


            smsocialbtn:
            [
                {
                    class: 'btn-sm',
                }

            ],
            mdsocialbtn:
            [
                {
                    class: 'btn-sm',
                }

            ]


        }


    }   
    render() {
        return (
            <div className="wrapper">
                 <section className="container">
                     <div className="row">
                         <Header header={this.state.header[0].title} />
                         <div className="col-md-12 mb-30">
                             <div className="h5 mb-20">Contained Button</div>
                              <p className="body1">Used for maximum emphasis.</p>
                         </div>
                         <div className="container">
                             <div className="row">
                                 <ul className="btn-list mb-30"> 
                                     <li>
                                         <Button size="btn-sm" style="btn-primary" label="Button"  />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-sm" 
                                             style="btn-primary" 
                                             label="Add Friend" 
                                             Lefticon={true}
                                             icon={<Icon icon={userPlus}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-sm" 
                                             style="btn-primary" 
                                             label="Next" 
                                             Righticon={true}
                                             icon={<Icon icon={chevronRight}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-sm" 
                                             style="btn-primary"
                                             CenterIcon={true}
                                             icon={<Icon icon={cloud}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button size="btn-sm" style="btn-primary" label="Disable"  disabled />
                                     </li>
                                 </ul>
                                 <ul className="btn-list mb-30"> 
                                     <li>
                                         <Button size="btn-md" style="btn-primary" label="Button"  />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-md" 
                                             style="btn-primary" 
                                             label="Add Friend" 
                                             Lefticon={true}
                                             icon={<Icon icon={userPlus}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-md" 
                                             style="btn-primary" 
                                             label="Next" 
                                             Righticon={true}
                                             icon={<Icon icon={chevronRight}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-md" 
                                             style="btn-primary"
                                             CenterIcon={true}
                                             icon={<Icon icon={cloud}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button size="btn-md" style="btn-primary" label="Disable"  disabled />
                                     </li>
                                 </ul>
                                 <ul className="btn-list mb-30"> 
                                     <li>
                                         <Button size="btn-lg" style="btn-primary" label="Button"  />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-lg" 
                                             style="btn-primary" 
                                             label="Add Friend" 
                                             Lefticon={true}
                                             icon={<Icon icon={userPlus}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-lg" 
                                             style="btn-primary" 
                                             label="Next" 
                                             Righticon={true}
                                             icon={<Icon icon={chevronRight}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button 
                                             size="btn-lg" 
                                             style="btn-primary"
                                             CenterIcon={true}
                                             icon={<Icon icon={cloud}  />}
                                              />
                                     </li>
                                     <li>
                                         <Button size="btn-lg" style="btn-primary" label="Disable"  disabled />
                                     </li>
                                 </ul>

